import { Nav, Navbar, Form, FormControl, Container, NavDropdown, Button, Modal} from 'react-bootstrap';
import { useState } from 'react';
import Mode from './Mode';
function Header() {
  const [fullscreen, setFullscreen] = useState(true);
  const [show, setShow] = useState(false);
  function handleShow() {
    setFullscreen(0);
    setShow(true);
  }
  return (<div className='header'>
         <Modal show={show} fullscreen={fullscreen} onHide={() => setShow(true)} style={{position:'fixed', zIndex:'999999999999'}}>
        <Modal.Header closeButton>
          <Modal.Title>Modal</Modal.Title>
        </Modal.Header>
        <Modal.Body>Modal body content</Modal.Body>
      </Modal>
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="#home">Rukn Al-Jazeera</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#services">Our Services</Nav.Link>
            <Nav.Link href="#about">About Us</Nav.Link>
            <Nav.Link href="#contact">Contact Us</Nav.Link>
          </Nav>
          <Nav  >
            <Nav.Link href="#" ><Button onClick={() => handleShow()}>Ourder Now</Button></Nav.Link>
            <Nav.Link href="tel:0588402232"><Button>Call: 0588402232</Button></Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  </div>

  );
}

export default Header;
